import VeuRouter from 'vue-router'

import Situation_List from "../pages/Situation-list";
import AddSituations from "../pages/Add-Situatins"

export default new VeuRouter({
    routes: [
        {
            path: '/',
            component: Situation_List
        },
        {
            path: '/AddSituations',
            component: AddSituations
        }
    ]
})
